import React, { useState } from 'react';
import GraphComponent, { FileUploader } from './components/GraphComponent'; // Предполагается, что FileUploader не экспортируется по умолчанию

export default function App() {

  this.state = {name: null}
  this.newValue = this.newValue.bind(this);

  return (
    <>
      <FileUploader graph2={this.newValue} />
      <GraphComponent graph={this.state.handleChange} />
    </>
  );
}
